import { Routes, Route } from "react-router-dom";
import PageHome from "./PageHome.jsx";
import Home from "./pages/Home";
import Menubar from "./pages/Menubar";

function App() {
  return (
    <>
      <Routes>
        <Route path="/" element={<Menubar />}>
          home
        </Route>
        <Route path="/home" element={<Home />}>
          home2
        </Route>
      </Routes>
    </>
  );
}

export default App;
